$(()=>{let t=function(t){var r=t.split("?")[1];if(!r)return!1;var a=r.split("&");if(!a)return!1;for(var c={},o=0;o<a.length;o++){var n=a[o].split("=");c[n[0]]=n[1]}return c}(window.location.href);$.ajax({url:"http://127.0.0.1:3000/api/getdiscountproduct",data:{productid:t.productid},dataType:"json",success:t=>{let r=t.result;$(".title").text(r.productName),$(".addtime").text(r.productTime),$(".author").text(r.productTips),$(".mall").text(r.productFrom),$(".picwrap img").attr({src:r.productImg.src,alt:r.productImg.alt}),$(".conn p").eq(1).text(r.productInfo),$(".conn p").eq(3).text(r.productName),$(".conn img").attr({src:r.productImgSm.src,alt:r.productImgSm.alt});let a="";r.productCity.forEach(t=>{a+=`\n                <li>\n                    <a href="javascript:;>\n                    <span>\n                    ${t.replace("有货","")}\n                    <strong>有货</strong>\n                    </span>\n                    </a>\n                </li>\n                `}),$("#disstorck").html(a)}})});